import React from "react";
import ReactDOM from "react-dom";
import add from "./calculator";

ReactDOM.render(
  <>
    <h1>Calculator</h1>
    <ul>
      <li>{add(1, 2)}</li>
    </ul>
  </>,
  document.getElementById("root")
);
